import React from 'react'
import { connect } from 'react-redux'
import { logout } from '../actions/currentUser.js'

const Logout = ({logout}) => {
   let buttons = document.querySelector('div.ui.buttons')

    return(
        buttons.remove()
    )
}

export default connect( null, {logout})(Logout)
